import Navbar from "./component/navbar/navbar.js";
import "./assets/css/App.css";

function App() {
  return (
    <BrowserRouter>
          <Routes>
      <Route path="/home" element={<Navbar />} /></Routes>
    </BrowserRouter>
  );
}

export default App;
